const endpoint = "https://api.soccermass.com/v1/apihub/clubs/random" + params;


const options = {
  method: "GET",
  headers: new Headers({
    "x-soccermass-host": "<developer's API id/host>", // <= App ID should go in here
    "x-soccermass-key": "<developer's API key>", // <= App Key should go in here  
    // ensure to pass Content-Type, else our Server won't parse your request
    "Content-Type": "application/json",
  }),
};


fetch(endpoint, options)
  .then((response) => response.json())
  .then((response) => console.log(response))
  .catch((err) => console.error(err));
};

